        e.preventDefault();
        this.props.nextStep();
    }
    render() {
        return (
            <div>
                <h1>
                    HI!Enter the name
                </h1>
                <div class="d-grid gap-2">
                  <button type="button" name="" id="" class="btn btn-primary">Button</button>
                </div>
            </div>
        )
    }

}

